window.bookSummaryJSON = "<p>The scum hiding deep inside the Reach out along galaxy's edge thought they could kill her and not pay the price. For years these hardened killers have run roughshod over the lawless worlds where Republic justice is never as fast as the blaster in your hand and where double-crosses and death are a part of every deal. They thought this time would be no different. </p> <p>They were wrong. </p> <p>This time, the Guild sent the legendary bounty hunter Tyrus Rechs. </p> <p>As the infamous Rechs pursues the men who murdered his colleague, he's hell-bent on justice, heedless of the trail of destruction he leaves across ruined worlds and fantastic gambling meccas alike. Because for Rechs, this isn't just another Guild contract...it's personal.</p>"; 
